import { useState } from "react";

const Prueba = () => {
  return (
    <div className="header">
      <div className="container">
        <div className="logo">
            <h1>Slee Dw</h1>
        </div>
        <nav className="menu">
            <a href="#">Inicio</a>
            <a href="#">Nosotros</a>
            <a href="#">Blog</a>
            <a href="#">Contacto</a>
        </nav>
      </div>
    </div>
  );
};
export default Prueba;
